import './App.css';

const App  = () => {
  const [ sidebarOpen, setSidebarOpen ] = useState(false);
  const opensidebar = () =>{
    setSidebarOpen(true);
  }
  return (
    <div ClassName="container">
      <h1>Hello World!</h1>
    </div>
  );
}

export default App;
